"description": "Beautiful wedding garter set made with clear glass crystal rhinestones in silver settings, ivory or white elastic stretch lace, satin bow and pearls in the center. The keepsake garter has a large rhinestone decoration that measures 2 1/2&quot; x 6&quot;. The toss garter has a satin bow and a pearl decoration. Choose your lace color, size, and bow color at checkout. If you select ivory lace you will receive ivory pearls and white lace will come with white pearls. If you want ivory pearls with white lace or vice versa, just let me know in the message to seller at checkout. \n\nHow To Measure for your size:\n\nUse a soft tape measure or a string and a ruler and measure 4-5&quot; above the top of your knee below the large back leg muscle. Measure a bit snug around your leg, not too tight or too loose and measure standing up. I will make adjustments for the stretch so please do not take off any inches. Your garters will stretch to fit. You may want to purchase fashion tape to secure your garter but it may not be necessary.\n\n******************************\n\nYour garter set will come in a white gift box for safe keeping before and after your special day.\n\nMore lovely crystal garters:\n\nhttps://www.etsy.com/shop/LoveForeverBridal?section_id=13306090&ref=shopsection_leftnav_2&view_type=gallery\n\n\nThank you for visiting Love Forever Bridal Boutique!",
