"title": "Personalized Pet Memorial Ornament, nickel silver, pets name and years lived around edge, 47 character max, please read listing",
"description": "**Please** check our policies page here:\nhttps://www.etsy.com/shop/riskybeads/policy\nfor current turnaround times, holiday deadlines, rush order and shipping options, etc. Thank you!\nWe recommend Priority Mail for all USA customers. First Class is taking too long.\nPersonalization details go in the blank white box in your cart.\nPlease take your time placing your order, double check personalization and ship to address.\n\nSometimes the loss of a pet can be made just a little easier with a keepsake.  I designed this ornament for my sister after the loss of her yellow lab. Each ornament is hand stamped, letter by letter, on a 1.5&quot; nickel silver disc with a red or green string for hanging on the tree. This particular design has a dog stamp, #104, in the middle with &#39;IN LOVING MEMORY&#39; stamped beneath it. Along the edge of the disc is the dog&#39;s name and years lived. I can fit about 47 characters around the edge using the smallest font pictured. \n\nORDER EARLY as I got sold a ton of these last year and had to turn some folks away! \n\nView other ornaments including bulk listings for them here:\nhttp://www.etsy.com/shop/riskybeads?section_id=5583753\n\n                              \nIf you need 48-57 characters instead, please order the LARGE ornament thru this listing:\nhttps://www.etsy.com/listing/158292198/large-personalized-silver-christmas\n57 characters which includes dots around edge is the most I can fit on an ornament.\n                               \n\nWhen you order, I need to know:\n\n1. What symbol and text you want in the middle.  Dog is #104 and cat is #103. The paw print stamp I have does NOT show up well on nickel silver because it&#39;s such a hard metal.\n2. What name(s) or wording you want around the edges\n\nPersonalization details go in the blank white box in your cart.\n\n***** PLEASE NOTE *****\nThis piece is created by hand using a hammer and metal letter and symbol stamps. Metal stamping is a quirky process - letters and symbols will never be completely straight or centered, darkening may be a bit uneven due to varying stamp depth, and stray marks may occur. These are not defects in your piece; they are what makes it unique and one of a kind. :)\n\nSee more memorial items here:\nhttps://www.etsy.com/shop/riskybeads/search?search_query=memorial\n\nSee more pet items here:\nhttps://www.etsy.com/shop/riskybeads?section_id=7869516\n\nTo add a charm, please see this listing:\nhttp://www.etsy.com/listing/77522580/add-a-charm-to-my-design-purchase-with\n\nView the rest of my shop here:\nhttp://www.etsy.com/shop/riskybeads\n\nOrnaments/key chains/bookmarks/zipper pulls are the perfect thoughtful gift for a teacher, babysitter, nanny, or just about anyone else on your list! They don&#39;t have to match anyone&#39;s wardrobe and they last forever.\n\n\nPlease see my policies for any current promotions!http://www.etsy.com/shop/riskybeads/policy\n\n\nNew to Etsy? Need help checking out? Please see this link:\nhttp://help.etsy.com/app/answers/detail/a_id/245/\n\nJewelry comes in a Risky Beads gift bag!\n\ncopyright Risky Beads\n\n\nHave any questions? Contact the shop owner.\n\n                                 \nPLEASE NOTE: We use up-close macro photography to capture detail for all of our listings. As a result, pieces may appear larger than they actually are.  Please read the actual dimensions of each piece in the item description and view all photos for scale.  Thank you.\n                                ",
