"sale_message": "***PLEASE READ THIS**\r\n\r\nThanks so much for your order and for supporting a micro-business!  \r\n\r\nNEW TO ETSY?? Please confirm your email with Etsy so that you will get our messages in the event we need to reach you. We  need to keep our communications ON Etsy so they tie to your order.  Please respond promptly so your order is not delayed.\r\n\r\n Current turnaround time is 5 BUSINESS DAYS for orders to LEAVE our studio.  Shipping times apply after that point. \r\n\r\n******\r\nUSA ORDERS - SHIPPING TIMES: (applies AFTER production time)\r\nFirst Class takes 2-7 days (approx.)\r\nPriority takes 2-3 days (approx.)\r\nPriority Express takes 1-2 days\r\n******\r\n\r\n******\r\nINTERNATIONAL ORDERS - SHIPPING TIMES: (applies AFTER production time)\r\nFirst Class takes 2-6 weeks (approx.)\r\nPriority takes 6-10 days (approx.)\r\nInternational customers are responsible for all customs/VAT fees.\r\n******\r\n\r\nRUSH ORDERS ship out in 2 **business** days vs. 5 business days. If you need this option after purchasing (and did not already purchase the rush option), please contact us. ",
"digital_sale_message": null,
"last_updated_tsz": 1467075487,
"listing_active_count": 1400,
"digital_listing_count": 0,
"login_name": "riskybeads",
"accepts_custom_requests": false,
"policy_welcome": "TURNAROUND TIME\r\n\r\nCurrent production time is 5 business days. Rush orders are available in your cart. A rush order ships out in 2 business days. All personalization not covered in a drop down menu goes in the blank white box in your cart.\r\n\r\nABOUT OUR PROCESS\r\n \t\r\nEach piece is hand stamped letter by letter, symbol by symbol with a hammer. No machines are used. Hand stamping means that letters/symbols will never be completely straight, perfectly positioned, or of equal depth/darkness. These features are not a flaw in the work but rather what makes each piece uniquely yours!\r\n\r\nWe use up-close macro photography to capture detail for all of our listings. As a result, pieces may appear larger than they actually are. Please read the actual dimensions of each piece in the item description and view all photos for scale. \r\n\r\nUSA CUSTOMERS:\r\n\r\nFirst class delivers in 2-7 days (no date guarantee)\r\nPriority delivers in 2-5 days (no date guarantee)\r\nPriority EXPRESS delivers in 1-2 with NO Saturday delivery\r\n(Shipping times do not alter our current **production** time of 5 business days.\r\n\r\nINTERNATIONAL CUSTOMERS\r\nWe offer USPS First Class, Priority International mail, and a RUSH + Priority Shipping Option. These options are in your cart.\r\n\r\n1. First Class leaves in 5 business days and can take anywhere from 1-6 weeks to arrive (no date guarantee).\r\n2. Priority International ships out in 5 business days and delivers in 6-10 days. Delivery dates are a guideline, not a guarantee.\r\n\r\nPlease be aware that many countries charge VAT (Customs) fees on imported goods. You are responsible for all customs fees. We ship worldwide and do not know the current fee thresholds for each country. \r\n\r\n\r\n\r\n\r\n",
"policy_payment": "SECURE OPTIONS\nEtsy keeps your payment information secure. Sellers don't receive your credit card information.\n- Visa\n- MasterCard\n- American Express\n- Discover\n- PayPal\n- Apple Pay\n- SOFORT Bank Transfer\n- iDEAL\n- Etsy Gift Card",
"policy_shipping": "PROCESSING TIME\nThe time I need to prepare an order for shipping varies. For details, see individual items.\n\nCUSTOMS AND DUTIES FEES\nBuyers are responsible for any customs or duties fees that may apply. Sellers aren't responsible for delays due to customs",
"policy_refunds": "I GLADLY ACCEPT RETURNS, EXCHANGES, AND CANCELLATIONS\nJust contact me within: 14 days of delivery\nShip returns back to me within: 30 days of delivery\nRequest a cancellation within: 12 hours of purchase\n\nTHE FOLLOWING ITEMS CAN'T BE RETURNED\nBecause of the nature of these items, unless they arrive damaged or defective, I can't accept returns for:\n- Custom or personalized orders\n- Items on sale\n\nCONDITIONS OF RETURN\nBuyers are responsible for return shipping costs.\nIf the item is not returned in its original condition, the buyer is responsible for any loss in value.\n\nQUESTIONS ABOUT YOUR ORDER?\nPlease contact me if you have any problems with your order.",
"policy_additional": "I will only use your shipping and billing address, and contact information\n- To communicate with you about your order\n- To fulfill your order\n- For legal reasons (like paying taxes)\n\nWHAT IS YOUR PROCESS (AKA WHAT IS HAND STAMPING)?\nWe make each piece one-at-a-time using a process called &#39;hand stamping.&#39; Every letter, number, and symbol you see on our pieces is hand stamped using steel font sets and symbols in set sizes and a hammer. Hand stamping forms a much deeper impression than engraving and due to hammering each letter, alignment will not be perfect. These factors contribute to the uniqueness of each piece we make.\n\nHOW WILL MY ORDER BE PACKAGED?\nAll of our pieces are packaged for gift giving the moment you receive them. They come in a fabric back, typically with our logo, that doubles as a gift bag.\n\nWILL YOU SEND A GIFT ON MY BEHALF?\nSure! We&#39;d love to. Please put the giftee&#39;s address in the &#39;ship to&#39; box when checking out and let us know who to say it&#39;s from. Please keep the note short so we can fit it on a business card sized gift card.\n\nWHERE DO I ADD PERSONALIZED INFO WHEN I ORDER?\nAll personalized info goes in the blank white box in your cart. Some items have drop down menus as well that allow you to make certain choices.\n\nDO YOU ACCEPT WHOLESALE OR BULK ORDERS?\nWe do a ton of bulk orders! Many of our listings have bulk pricing built in, but if it isn&#39;t there, feel free to ask. We can handle orders of any size. \n\nWe are not accepting new wholesale or consignment accounts at this time.\n\nCAN YOU STAMP THE BACKSIDE OF THE METAL?\nSometimes. We can backside on certain types of aluminum keychains only, and if backside wording is permitted, then the listing will say so *and* will specify how many characters are allowed on the back. We cannot stamp the back of non-aluminum pieces. \n\nBecause hand stamping is done by hammering letters/symbols into the metal, impressions are left on the reverse side.  This means that we can only permit backside stamping when we&#39;re able to hide those impressions. This also means that the backside wording needs to be shorter than the front side wording.\n\nDO YOU ACCEPT RUSH ORDERS?\nUsually, yes. We have a standard production time (typically 1-2 weeks which varies depending on time of year), and when we&#39;re not completely busy, we allow rush orders for an additional fee. A rush order ships out in 2 **business** days vs. our standard production time. Rush orders are available in your cart. \n\nPlease note that none of our rush options offer overnight delivery.\n\nARE YOUR ITEMS ALREADY MADE?\nWe typically hand stamp each order as it comes in because much of our work is custom or personalized.  *Sometimes* we may have a certain design in stock, but this is not the rule.\n\nWHAT COUNTRIES DO YOU SHIP TO?\nAs of 6/25/16, we are no longer shipping to some countries due to lost packages or postal strikes (Canada). Once Canada resolves their postal issues, we will add them back to the list. We currently ship to the following countries: Australia, Bahamas, Belgium, Bermuda, Brazil, China, Denmark, Dominican Republic, Finland, France, Germany, Greenland, Guam, Jamaica, Iceland, Ireland, Israel, Italy, Japan, Luxembourg, Malaysia, Netherlands Antilles, New Zealand, Norway, Philipines, Portugal, Puerto Rica, Russia, Singapore, Spain, Switzerland, Sweden, Thailand,The Netherlands, United Kingdom, USA, and the US Virgin Islands.",
"policy_seller_info": "",
