"vacation_autoreply": "Hi! Risky Beads is taking a short break to catch up on orders. We hope to reopen the week of 6/13/16. Please visit the front of our store to be notified by email when we return:\r\nhttps://www.etsy.com/shop/riskybeads\r\nThis message is an auto-reply and we are here to answer questions. Please read our FAQs below containing to answers to our most common questions:\r\n\r\n&gt;Will my order arrive in time for Father&#39;s Day? \r\n\r\nAll orders placed on 6/5 and earlier should arrive in time for Father&#39;s Day. They will be shipped out no later than 6/15 and depending on the shipping method you chose, can take 2-5 days from that point. Please note that this is an approximation. We cannot guarantee USPS delivery dates; we can only follow their guidelines.\r\n\r\n&gt; How will I know when my order is supposed to ship?\r\n\r\nYou can see the date that your order ships/shipped by:\r\n*logging into Etsy\r\n*clicking on &#39;my account&#39; in the top right hand corner\r\n*clicking on &#39;purchases & reviews\r\n*clicking on the order number\r\n*on the right hand side of the page, the shipping date will be there in the transaction details\r\n\r\n&gt; How do I track my package? \r\nFollow the same steps outlined above. Follow the links to USPS.com and look at their version for the latest info. Sometimes Etsy&#39;s site doesn&#39;t update as fast as the USPS site.\r\n\r\n\r\n~Lori \r\n(This is an automatic reply sent by my shop.)",
