"accepts_custom_requests": true,
"policy_welcome": "Welcome to Crafting Fabrics! \r\nCreative and Unique Fabrics and Crafting Supplies. \r\n\r\nYour satisfaction is a # 1 priority to me and I love happy customers and I will always try my best to ensure you are completely satisfied! :)\r\n\r\nQuestions with your order? If for any reason you are missing something from your order or there are any questions please message us right away.   Discrepancies need to be addressed within 24 hours of the receipt of your package.\r\n\r\nCOLORS- I have done my best to display as accurately as possible the colors of the products shown on t he Site. However, because the colors you see will depend on your monitor, I cannot guarantee that your monitors display of any color will be accurate. \r\n\r\nFLAWS - Small flaws occur sometimes in fabric weaving and printing.  We do our best to examine fabric when it is purchased and when it is shipped.  Returns for small flaws are not accepted.",
"policy_payment": "Payment is due at check out.  Orders are processed after payments are cleared and shipped according to my shipping policies.\r\n\r\nOnce the order is placed we do not accept cancellations.  Fabric is pulled and cut upon receipt of the order and shipped as soon as possible.",
"policy_shipping": "Your product will be shipped via USPS after payment is cleared and your order is ready. My average ship time is 1 to 3 business days.  I am closed weekends and all major holidays (though I do watch my messages in case you need something or have a question).\n\nIf you want to make a change to your order please request a custom order.\n\nEverything under 16 oz ships 1st class mail.  Everything above 16 oz ships priority mail depending on the situation.\n\nFirst Class Mail does not include insurance, but does include tracking.  Priority Mail does include a limited amount of insurance and tracking.  I&#39;m not responsible if USPS looses a package that is uninsured.  If you want to insure a package I will need to prepare a custom order for you.  Please contact me BEFORE you place your order.\n\nConvo me if you have any questions about shipping or charges BEFORE you place an order.  There are no shipping refunds.\n\nInternational Shipping is not available at this time.  I will ship to Canada if you request a custom order so that I can adjust the shipping correctly.\n\nNote:\nI cannot ship to an address different than that listed on the PayPal Ship to Transaction.",
"policy_refunds": "If there is a problem with your order please let us know right away.  In most cases we can correct any issues very quickly. Discrepancies need to be reported within 24 hours (one day) of the receipt of an item shipped.   In the event of a refund, you will be refunded the amount of your product less all shipping fees upon receipt / return of items.  Buyer pays return shipping.\r\n\r\nFabric cannot usually be returned as it it cut to order and considered a custom order.\r\n  \r\nChristmas items are not returnable as they are made to order and considered a custom order.\r\n\r\nPostage is automatically figured by the system.   We do not offer refunds for unused postage at this time.  Custom Orders for over 1-1/2 yards can be requested at any time to adjust shipping rates.\r\n\r\nIf you are buying a lot of fabric (over 2 yards) you might consider a custom order.   It is common that the system  may figure more shipping than is needed for larger amounts of fabric and most likely the order needs to ship Priority Mail.\r\n\r\nConvo me if you have any questions.",
