"announcement": "Sign up to the newsletter for DISCOUNTS and FREEBIES http://eepurl.com/GS3Kz\n\nThank you for visiting my store!\n\nI create and sell original digital designs including clip art, digital papers, and digital stamps, for your personal or commercial craft projects, scrapbooking and paper crafts.\n\nAll items are delivered by Etsy INSTANT DOWNLOAD, so orders are delivered to you immediately!",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": "Hello! My shop is on vacation for a short while to give me time to move house. I am hoping to be open again on, or shortly after, 24th July 2014 - Tanya x",
"sale_message": "Many thanks for purchasing from Pininkie!  \r\n\r\n    SAVE ON YOUR NEXT ORDER    \r\n\r\nFor 10% off your next order, enter coupon code THANKYOU2016 at checkout. \r\n\r\n    NEWSLETTER    \r\n\r\nSubscribe to the Pininkie newsletter to hear about the latest offers, freebies and news! http://eepurl.com/GS3Kz\r\n\r\n    YOUR ORDER    \r\n\r\nInstantly downloadable items are available immediately after payment. Etsy will send you a link to the download page. There, you can download all the files associated with your order. For more help on downloading from Etsy, please see http://www.etsy.com/uk/help/article/3949\r\n\r\nIf you have any questions about your order, please contact me.\r\n\r\nFor my full policies please see http://www.etsy.com/shop/Pininkie/policy\r\n\r\n\r\nKind regards\r\n\r\nTanya",
"digital_sale_message": "Many thanks for purchasing from Pininkie!  \r\n\r\n    SAVE ON YOUR NEXT ORDER    \r\n\r\nFor 10% off your next order, enter coupon code THANKYOU2016 at checkout.\r\n\r\n    NEWSLETTER    \r\n\r\nSubscribe to the Pininkie newsletter to hear about the latest offers, freebies and news! http://eepurl.com/GS3Kz\r\n\r\n    YOUR ORDER    \r\n\r\nIf you need help on downloading from Etsy, please see the Etsy help article http://www.etsy.com/uk/help/article/3949\r\n\r\n\r\nIf you have any questions about your order, please contact me.\r\n\r\nFor my full policies please see http://www.etsy.com/shop/Pininkie/policy\r\n\r\n\r\nKind regards\r\n\r\nTanya",
