"policy_welcome": "Hello and welcome to Pininkie!\r\n\r\nHere you will find a a range of downloadable products.\r\n\r\nYou will find my shop policies below.  If you have any questions please feel free to contact me and I will get back to you ASAP.\r\n\r\n    NEWSLETTER    \r\nSubscribe to the Pininkie newsletter to hear about the latest offers, freebies and news! http://eepurl.com/GS3Kz\r\n\r\nTanya x",
"policy_payment": "SECURE OPTIONS\nEtsy keeps your payment information secure. Sellers don't receive your credit card information.\n- Visa\n- MasterCard\n- American Express\n- Discover\n- PayPal\n- Apple Pay\n- SOFORT Bank Transfer\n- iDEAL\n- Etsy Gift Card",
"policy_shipping": "DIGITAL DOWNLOADS\nYour files will be available to download once payment is confirmed.",
"policy_refunds": "I DON'T ACCEPT RETURNS, EXCHANGES, OR CANCELLATIONS\nBut please contact me if you have any problems with your order.",
"policy_additional": "I will only use your shipping and billing address, and contact information\n- To communicate with you about your order\n- For legal reasons (like paying taxes)\n\nDO YOU INCLUDE A COMMERCIAL USE LICENCE?\nYes! The &quot;Pininkie Small Commercial Licence&quot; (CU) is for owners of small, home run businesses such as those with Etsy stores and is included with each product.\nThe license applies to sole traders and individuals only.\nCredit is not required but always appreciated.\nAny reselling or distributing of the original, un-altered product or without significant change, in any type of printed or digital format is strictly prohibited.\nAll copyrights remain with Pininkie (Tanya Stovold).\n\nAM I ALLOWED TO USE THE PRODUCTS TO MAKE MY OWN DIGITAL PRODUCTS?\nYes, you may use the products in your own digital products that you sell to a customer for their own personal use only. The final design must be compete (e.g. not a template) and must be in a flattened format. The original product must never be sent to your customer.\n\nAM I ALLOWED TO USE THE PRODUCTS TO MAKE ELEMENTS FOR THE WEB?\nYes, you may use the product to design blog elements, website elements, banners and logos for yourself or to sell to a customer for their own personal use only. The final design must be personalised to the individual customer and must be in a flattened format with a maximum of 72 DPI. The original product must never be sent to your customer.\n\nAM I ALLOWED TO USE THE PRODUCTS TO MAKE TANGIBLE/PHYSICAL PRODUCTS?\nYes, you may use print the products to incorporate them in to your own tangible creations, such as bottle cap jewellery, magnets, badges/buttons, stickers etc.\nYou may print up to 1000 physical prints of the product per purchase.\n\nAM I ALLOWED TO USE THE PRODUCTS TO MAKE PLANNER STICKERS?\nYou may use my papers for PLANNER STICKERS as long as you add something to the design - e.g. you don&#39;t just resize/crop them and compile them on to a sheet. You&#39;d need to add something of your own to them.\n\nARE THERE ANY LICENCE RESTRICTIONS?\nThere are. You may NOT:\n claim the product as your own.\n redistribute the product in its original, un-altered form in any way, including, but not limited to selling, forwarding, sharing, giving away as freebies.\n use the product to create a digital templates for others to personalise.\n use the product on third-party print-on-demand companies such as Zazzle, CafePress, Spoonflower, etc.\n use the product in the creation of any type of surface pattern design printed digitally, such as fabric, wallpaper, wrapping paper, tape or ribbon.\n sell the product either alone or as part of a kit as a design resource for designers or scrapbookers.\n\nMAY I CONVERT THE PRODUCTS?\nYou may NOT convert the products in to a vector/SVG/Cutting file format or any file types of a similar nature, either in their original or altered format.\nYou may NOT convert the product into brushes/tubes or shapes, create rubber stamps from the image, resell as clip art, sell as digital collage sheets, or sell as layered templates of any kind.\n\nWHAT FORMAT WILL I RECEIVE?\nFile formats may include ZIP files, JPGs, PNGs or other. Please check the individual listing for more details.\nFormats are in high quality 300 DPI.\nYou will need software that supports the format specified on the listing.\n\nWILL THE COLOURS BE EXACTLY AS I SEE ON SCREEN?\nColours may vary slightly depending on your monitor and printer.\nPrint quality will vary between printers, paper types and inks used.",
