"policy_welcome": "Hello and welcome to our shop!\r\n\r\nWe love to design, paint and photograph what we love! Unique designs, movie & music & book posters, travel illustrations, paintings, photography and so much more =)\r\n\r\nHope you enjoy our shop and please come back for more cool designs!\r\n\r\nThe Hog Team",
"policy_payment": "We accept Paypal, Etsy Gift Cards and Credit Cards. Should you have any further questions, please send us a message. ",
"policy_shipping": "Your order will be dispatched as quick as possible from when your payment is cleared. We aim to process, print and dispatch your order within 1-2 working days. (Personalized items may take longer.)\r\n\r\n A5-A4 prints ship with hard cardboard back envelope. Each print is incased in a plastic cover for extra protection.\r\n A3-A2-A1 prints ship with cardboard poster tube.\r\n\r\nWithin the UK, your order will be sent via Royal Mail 1st Class Delivery which usually takes 1 working day to deliver. Also you can look for upgrades. \r\n\r\nIf you order from outside the UK, your order will be sent via Royal Mail International Standart or Royal Mail International Tracked Delivery (see shipping upgrades), which aim to deliver within 5-10 working days.\r\n\r\nPlease check Royal Mail website for average shipping times for your area. \r\n\r\n* All orders are shipped via Royal Mail Standard shipping (which does NOT include tracking number) unless you choose SHIPPING UPGRADE while checking out.\r\n\r\nInternational buyers are responsible for all additional customs fees, taxes or receiving fees due to policies of their receiving country.\r\n\r\n",
"policy_refunds": "\tWe cancel and refund any order that has not been shipped yet. We can&#39;t refund once a print has been dispatched.\r\n\r\n\tPlease note that, once customized order is printed it cant be cancelled or refund. If youve ordered a custom piece, you will receive a proof of the artwork via message for approval before the artwork is produced. We are happy to make adjustments at that moment.\r\n\r\n\tIf we make an error we will issue 100% full credit or replacement at no cost.\r\n\r\n\tIf the item is damaged during shipping, please take a picture and send it to us, your new print will be sent to you without any extra charge.\r\n\r\n       Lost items during shipping are not our responsibility. If you would like to track your item please chose [Upgraded Shipping]. \r\n\r\n\tIf for any reason you are not satisfied please contact us within 5 business days after receiving the item. You&#39;ll get a full refund if it&#39;s sent back unused and in original condition. Return shipping is buyer&#39;s responsibility.\r\n\r\n*** We want all our customers to be HAPPY! *** \r\n\r\nTherefore, if you have any problem with your artwork, please send us a message before leaving a feedback. We will definitely resolve it!",
"policy_additional": "We love custom designs! Feel free to ask us for any customization! Also we are able to do wholesales, just contact us so we can discuss further issues. \r\n\r\nthehogart [at] gmail.com",
